import React from 'react';
import '../styles/components/layout.css';
import '../styles/pages/school-detail.css';

const SchoolDetailPage = () => {
    return (
        <div className="school-detail-page">

            <div className="breadcrumb">Trang chủ </div>

            <main className="content">
                <aside className="side-menu">
                    <ul>
                        <li>Giới thiệu</li>
                        <li>Danh sách ngành đào tạo</li>
                        <li>Điểm chuẩn</li>
                        <li>Phương án tuyển sinh</li>
                        <li>Học phí</li>
                    </ul>
                </aside>
                <section className="main-content">Main Content</section>
            </main>

        </div>
    );
};

export default SchoolDetailPage;
